/**
 * Class Name: productImportBl
 * Purpose: Business logic class for product import and export.
 */

//#region Imports
let Product = require('mongoose').model('Product');
let Division = require('mongoose').model('Division');
let ProductModel = require('mongoose').model('productModel');
let UploadedExcel = require('mongoose').model('UploadedExcel');
mongoose = require('mongoose');
const xlsx = require('xlsx');
//#endregion

//#region Constants declaration
const PRICES_META_DATA = [
    {
        key: "EX_SHOWROOM",
        label: "Ex-showroom Price",
        type: "default"
    },
    {
        key: "INSURANCE",
        label: "Insurance (I) NIL DEP.",
        type: "default"
    },
    {
        key: "REGISTRATION",
        label: "RTO TAX & Charges (I)",
        type: "default",
        isTag: true
    },
    {
        key: "ACCESSORIES",
        label: "Accessories Value",
        type: "default"
    },
    {
        label: "Logistic Charges",
        type : "custom"
    },
    {
        label: "TCS Charges",
        type : "custom"
    }
];

const INSURANCE_META_DATA = [
    {
        name: "Insurance (I) NIL DEP.",
        tag: "RTO TAX & Charges (I)",
        default: false
    },
    {
        name: "Insurance (Corp) NIL DEP.",
        tag: "RTO TAX & Charges (Corp)",
        default: false
    }
];

const EXPORT_META_DATA = [
    {
        key: "EX_SHOWROOM",
        label: "Ex-showroom Price",
        type: "default"
    },
    {
        label: "Logistic Charges",
        type : "custom"
    },
    {
        label: "TCS Charges",
        type : "custom"
    }
];

const dummyImage = "data:image/png;base64,";
//#endregion

//#region Public Functions

/**
 * Import product excel
 * @param req request objecct
 * @param res response object
 * @returns {{p: string}}s
 */
async function importProduct(req, res) {
    let workbook = xlsx.read(req.files.file.data, {type: "buffer", sheets: "MASTER PRICE LIST"});
    let Sheets = workbook.Sheets;
    let SheetNames = workbook.SheetNames;
    let sheetData = xlsx.utils.sheet_to_json(Sheets[SheetNames[0]], {range: 0});
    let uploadedFile = new UploadedExcel();
    uploadedFile.filename = req.files.file.name;
    uploadedFile.status = "importing";
    uploadedFile.progress = 0;
    uploadedFile.totalRecords = sheetData.length;
    uploadedFile = await uploadedFile.save();

    res.status(200).json({
        fileId: uploadedFile._id,
        totalRecords: uploadedFile.totalRecords,
        status: uploadedFile.status,
        progress: uploadedFile.progress
    });

    let classification = {};

    try {
        for (let product of sheetData) {
            let divId = await resolveClassifier(product['Division'], 1, classification);
            classification = {
                divId,
                currentParent: divId
            };

            let sectionId = await resolveClassifier(product['Section'], 2, classification);
            classification = {
                ...classification,
                sectionId,
                currentParent: sectionId
            };

            let subSectionId = await resolveClassifier(product['Sub-Section'] || product['Section'], 3, classification);
            classification = {
                ...classification,
                subSectionId,
                currentParent: subSectionId
            };

            let model = await resolveModel(product['Model'], classification, req.user._id);
            classification = {
                ...classification,
                modelId: model.modelId,
                model: model.modelName
            };

            await resolveProduct(product, classification, req.user._id);

            classification = {};
            await UploadedExcel.updateOne({_id: uploadedFile._id}, {$inc: {progress: 1}})
        }
        await UploadedExcel.updateOne({_id: uploadedFile._id}, {status: "success"});

    } catch (e) {
        await UploadedExcel.updateOne({_id: uploadedFile._id}, {status: "failed"});
        throw new Error(e);
    }
}

async function getUploadedExcelStatus(req){
    let excelData = await UploadedExcel.findOne({_id: req.query.fileId});
    return {
        status: excelData.status,
        progress: excelData.progress
    }
}

async function exportProducts(req, res){
    let products = await Product.find({status:{$ne :"Delete"}});
    let divisions = await  Division.find().select({value: 1});
    let models = await ProductModel.find().select({model: 1});
    let sheetData = [];
    for(let product of products){
        let divData = await resolveDivSecSubSection(product,divisions);
        let priceDetails = await resolvePriceDetails(product.priceDetails);
        let inshuDetails = await resolveInshuDetails(product.insuranceDetails);

        let obj = {
            "Division": divData.divName,
            "Section": divData.secName,
            "Sub-Section": divData.subSecName,
            "Model": models.find(x => x._id.toString() === product.modelId).model,
            "Fuel type": product.type === "gas" ? "CNG" : product.type,
            "VC Code": product.vcNo,
            "Variant" : product.variant,
            "Variant Description" : product.description,
            "Ex-showroom Price" : priceDetails["Ex-showroom Price"],
            "Insurance (I) NIL DEP." : inshuDetails["Insurance (I) NIL DEP."],
            "RTO TAX & Charges (I)" : inshuDetails["RTO TAX & Charges (I)"],
            "Insurance (Corp) NIL DEP." : inshuDetails["Insurance (Corp) NIL DEP."],
            "RTO TAX & Charges (Corp)" : inshuDetails["RTO TAX & Charges (Corp)"],
            "Logistic Charges" : priceDetails["Logistic Charges"],
            "TCS Charges" : priceDetails["TCS Charges"]
        };
        sheetData.push(obj)
    }
    let sheet = xlsx.utils.json_to_sheet(sheetData, {
        header: ["Division", "Section", "Sub-Section", "Model", "Fuel type", "VC Code", "Variant", "Variant Description", "Ex-showroom Price", "Insurance (I) NIL DEP.", "RTO TAX & Charges (I)", "Insurance (Corp) NIL DEP.", "RTO TAX & Charges (Corp)", "Logistic Charges", "TCS Charges"]
    });

    let workbook = xlsx.utils.book_new();

    xlsx.utils.book_append_sheet(workbook, sheet, "MASTER PRICE LIST");

    // xlsx.writeFile(workbook, 'ProductList.xlsx',{
    //     type: "file",
    //     bookType: "xlsx"
    // });
    res.send(workbook);
}

//#endregion

//#region Private Function
async function resolveClassifier(name, type, hierarchy){
    let query = {value: name, type: type, status: "Active"};
    if(hierarchy.currentParent) query.parentId = hierarchy.currentParent;
    let classifier = await Division.findOne(query);

    if(!classifier) classifier = await createClassifier(name, type, hierarchy);

    return classifier._id.toString();
}

async function createClassifier(name, type, hierarchy){
    let parentDivisionModel = new Division();
    parentDivisionModel.value = name;
    parentDivisionModel.parentId = hierarchy.currentParent;
    parentDivisionModel.type = type;
    parentDivisionModel.status= "Active";
    if(type === 3) parentDivisionModel.divId= hierarchy.divId;
    await parentDivisionModel.save();

    return parentDivisionModel;
}

async function resolveModel(modelName, hierarchy, userId){
    let model = await ProductModel.findOneAndUpdate({model: modelName}, {
        divId: hierarchy.divId,
        sectionId: hierarchy.sectionId,
        subSectionId: hierarchy.subSectionId,
        status: "Active",
        createdBy: userId
    }, {new: true, upsert: true});

    return {
        modelId: model._id.toString(),
        modelName: model.model
    };
}

async function resolveProduct(product, classification, userId){
    let previousProduct = await Product.findOne({vcNo: product["VC Code"]});
    let previousInsuranceDetails = previousProduct ? previousProduct.insuranceDetails : [];
    let previousPriceDetails = previousProduct ? previousProduct.priceDetails : [];
    let fuelType = product["Fuel type"].toLowerCase();
    fuelType = fuelType === "cng" ? "gas" : fuelType;
    let productDetails = {
        type: fuelType,
        modelId: classification.modelId,
        divId: classification.divId,
        sectionId: classification.sectionId,
        subSectionId: classification.subSectionId,
        model: classification.model,
        variant: product.Variant,
        description: product['Variant Description'],
        productName: classification.model + " " + product.Variant,
        insuranceDetails: getInsuranceDetails(product, previousInsuranceDetails),
        priceDetails: getPriceDetails(product, previousPriceDetails),
        colorDetails: getColorDetails(previousProduct),
        totalPrice: 0,
        status: 'Disabled',
        excelStatus: 'imported',
        lastUpdatedSource: 'excel',
        createdBy: userId,
        excel: true,
        compare: [ { competitor: classification.model + " " + product.variant, features: {} } ]
    };

    await Product.updateOne({vcNo: product["VC Code"]},
        {$set: productDetails},
        {upsert: true});
}

function getInsuranceDetails(product, previousInsuranceDetails){
    let details = [];
    let insurance, oldInsurance = previousInsuranceDetails;

    for(let data of INSURANCE_META_DATA){
        let existingInsurance = previousInsuranceDetails.find(x => x.name === data.name);
        if(product[data.name]){
            insurance = existingInsurance ? {_id: existingInsurance._id}: {};

            insurance = {
                ...insurance,
                name: data.name,
                amount: product[data.name],
                default: data.default
            };

            if(product[data.tag]){
              insurance.showTag = true;
              insurance.tagDetails = {
                  name: data.tag,
                  amount: product[data.tag]
              }
            }

            oldInsurance = oldInsurance.filter(i => i.name !== data.name);
            details.push(insurance);
        }
    }

    let finalInshu = [...details, ...oldInsurance];

    if (finalInshu.find(x => x.default)) return finalInshu;

    if (finalInshu.length > 0) finalInshu[0].default = true;

    return finalInshu;

}

function getPriceDetails(product, previousDetails){
    let priceDetails = [], detail = {};
    let oldPrices = previousDetails;

    for(let data of PRICES_META_DATA){
        let existingPrice = previousDetails.find(x => x.label === data.label);

        if(product[data.label]){
            detail = existingPrice ? {_id : existingPrice._id} : {};

            detail = {
                ...detail,
                key: data.key,
                label: data.label,
                amount: product[data.label],
                tax: null,
                type: data.type,
                isTag: data.isTag
            };
            oldPrices = oldPrices.filter(p => p.label !== data.label);
        }else  if(data.type === "default" && !existingPrice){
            detail = {
                key: data.key,
                label: data.label,
                amount: 0,
                tax: null,
                type: data.type,
                isTag: data.isTag
            };
        } else continue;

        priceDetails.push(detail);
    }

    return [...priceDetails, ...oldPrices];
}

function getColorDetails(previousDetails){

    if(previousDetails && previousDetails.colorDetails.length > 0) return previousDetails.colorDetails;
    return [
        {
            colorName: "New",
            colorCode: "#ffffff",
            premiumPrice: "",
            image: dummyImage,
            dummy: true
        }
    ]
}

async function resolveDivSecSubSection(product,divisions){
    let divName = divisions.find(x => x._id.toString() === product.divId);
    let secName = divisions.find(x => x._id.toString() === product.sectionId);
    let subSecName = divisions.find(x => x._id.toString() === product.subSectionId);
    return {
        divName: divName.value,
        secName: secName.value,
        subSecName: subSecName.value
    }
}

async function resolvePriceDetails(priceDetails) {
    let obj = {};
    for (let exportData of EXPORT_META_DATA) {
        let data = priceDetails.find(x => x.label === exportData.label);
        obj[exportData.label] = data ? data.amount : "";
    }
    return obj;
}

async function resolveInshuDetails(insuranceDetails) {
    let obj = {};
    for (let insuranceData of INSURANCE_META_DATA) {
        let data = insuranceDetails.find(x => x.name === insuranceData.name);
        if (data && data.showTag) obj[data.tagDetails.name] = data.tagDetails ? data.tagDetails.amount : "";
        obj[insuranceData.name] = data ? data.amount : "";
    }
    return obj;

}

//#endregion

//#region Exports
module.exports.importProduct = importProduct;
module.exports.exportProducts = exportProducts;
module.exports.getUploadedExcelStatus = getUploadedExcelStatus;
//#endregion